  Waipari Station
  Waipari is part of what was the 21,000 acre Mangakuri Station owned by Archdeacon Sam Williams
  (refer entry for James Nelson Williams in this book, and p 212 of "Samuel Williams of Te Aute" by
  Sybil Woods). The original station extended from Kairakau Beach in the North to almost as far
  south as Pourere Beach. The original 16-stand woolshed built in 1883 is still in use on Waipari.
  The Waipari block of 5,225 acres was split off for Lucy Frances Warren (nee Williams) in the early
  1900s and was later left to Lucy's sons, Alwyn and Greville and farmed by them in partnership. In
  1961, 2,040 acres known as Pukerangi was split off for Greville's family. Waipari is now 1,278 ha
  (3,200 acres) and is owned by the Warren family and farmed by Mark. It is operated as a diverse
  agribusiness, running 10,000 stock units and including 210 ha of forestry. Mark has diversified
  the land use by producing branded bottled mineral water with the plant on site as well as a 4WD
  training course on 20 acres.
  01> WARREN, William Peter Averill
  b 19.06.1996
  In the Christchurch Cathedral are two adjacent carved stone memorial panels, the one to Bishop
  A K Warren, great-grandfather of William and his brother Henry, and the other to Archbishop A W
  Averill, their great-great-grandfather.
  02> WARREN, Henry George Fox
  b 23.09.1997
  02> WARREN, Celia Jean
  b 24.11.1962
  Address: The Gatehouse, Silverton, Peel Forest, RD 22, Geraldine.
  Celia was educated at Geraldine Primary School, St Margaret's College and The
  Talland School of Equitation in Cirencester, England. She qualified as an interior
  decorator, a British Horse Society riding instructor, a New Zealand Equestrian
  Federation coach, and a Royal Agricultural Society judge, and holds the New Zealand
  Pony Club 'A' and 'H' Certificates.
  Celia lives on a sheep and cattle farm at Peel Forest where she combines interior decorating and
  casual farm work with instructing and running the Peel Forest Riding Holiday Camps. She judges and
  competes in equestrian competitions on a regular basis, and particularly enjoys hunting, skiing,
  ice skating and jet boating.
  03> WARREN, Nicola Frances m on 10.02.1959 to BUSH, Paul David Horndon
  Caroline
  b 28.10.1937
  b 20.03.1929
  Nicola b. and m. at Christchurch. Paul, slo Commander DGH Bush and U G Rattray. Address: Iona,
  Parnassus, Cheviot, North Canterbury.
  Nicola was educated in Christchurch at Selwyn House School and St Margaret's College, where she was
  head prefect. She attended Physiotherapy School in Dunedin and graduated DipPTY (Physiotherapy) in
  1958.
  Paul graduated DipAg from Cirencester, UK, and farms "Iona", Parnassus. He is a Serving Brother of the
  Order of St John.
  Nicola has her own physiotherapy practice at the Cheviot Medical Centre where she has practised since
  1978. She has been involved with local community organisations, being president of the Cheviot Plunket
  Society, secretary of the Cheviot and Hurunui Pony Clubs, a member of the St John's Anglican Church and
  the Cheviot Cancer Support Group, and a St John Ambulance officer and ambulance driver. She was
  elected the first female "Fellow" to the Board of Governors of Christ's College, Canterbury.
